import { configureStore } from '@reduxjs/toolkit'
import modalSlice from './actionCreators/modalSlice'
import stringReducer  from './actionCreators/dataSlice';

export default configureStore({
  reducer: {
    modal: modalSlice,
    string: stringReducer ,
  }
})
